    false,nt"url": null,nt"notes": " A 1:24,000-scale, geologic map of the
    Meadview North 7.5' Quadrangle in Mohave County, Arizona and Clark County, Nevada,
    with description of 54 geologic units. 1:24,000-scale, geologic map of the Meadview
    North 7.5' Quadrangle in Mohave County, Arizona and Clark County, Nevada, with description
    of 54 geologic units. The GIS work was in support of the U. S. Geological Survey
    COGEOMAP program. The Geodatabase specifies feature datasets and feature classes,
    together with feature attributes, subtypes and domains, suitable for the printed
    geologic map. In addition to basic geology (lithology, contacts and faults, etc.),
    the maps may include metamorphic overprints, cross-sections, and explanatory legend-graphics
    such as correlation charts, used to supplement columnar legends. The Geologic Map
    of the Meadview North 7.5' Quadrangle in Mohave County, Arizona and Clark County,
    Nevada 1:24,000-scale is available for download online in Portable Document Format.",nt"license_title":
